import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {

  const [pokemon, setPokemon] = useState('caterpie');
  const [pokemonData, setPokemonData] = useState([]);
  const [pokemonType, setPokemonType] = useState("");

  const getPokemonData = async () => {
    const pokeArray = [];
    const url = 'https://pokeapi.co/api/v2/pokemon/caterpie';
    const res = await axios.get(url);
    pokeArray.push(res.data);
    setPokemonType(res.data.types[0].type.name);
    setPokemonData(pokeArray);
  }
  getPokemonData();
  console.log(pokemonData);
  console.log(pokemonType);

  return (
    <>
    <header className="header">
      <h1> Test Hi</h1>
    </header>
    <body className="App">
      <div className="Sidebar">
        <button className="button"> A-Z </button>
        <button className="button"> Catagorized </button>
      </div>
    </body>
    </>
  );
}

export default App;
